import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  TableBody,
  TableContainer,
  Table,
  TableHeader,
  TableCell,
  TableRow,
  TableFooter,
  Avatar,
  Badge,
  Pagination,
} from "@windmill/react-ui";

const OrdersTable = ({ resultsPerPage, filter }) => {
  const [page, setPage] = useState(1);
  const [data, setData] = useState([]);
  const [totalResults, setTotalResults] = useState(0);

  function onPageChange(p) {
    setPage(p);
  }

  const fetchData = async () => {
    try {
      const token = localStorage.getItem("accessToken"); // Replace with your actual Bearer token
      const config = {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      };

      const response = await axios.get("http://localhost:8080/api/orders/all", config);
      const ordersData = response.data;

      let filteredData = ordersData;
      if (filter === "paid") {
        filteredData = ordersData.filter(order => order.status === "Paid");
      } else if (filter === "un-paid") {
        filteredData = ordersData.filter(order => order.status === "Un-paid");
      } else if (filter === "completed") {
        filteredData = ordersData.filter(order => order.status === "Completed");
      }

      const flattenedGroups = filteredData.flatMap(order => order.groups);
      setTotalResults(flattenedGroups.length);
      setData(flattenedGroups.slice((page - 1) * resultsPerPage, page * resultsPerPage));
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  useEffect(() => {
    fetchData();
  }, [page, resultsPerPage, filter]);

  return (
    <div>
      <TableContainer className="mb-8">
        <Table>
          <TableHeader>
            <tr>
              <TableCell>Client</TableCell>
              <TableCell>Order ID</TableCell>
              <TableCell>Amount</TableCell>
              <TableCell>Status</TableCell>
              <TableCell>Type</TableCell>
              <TableCell>Date</TableCell>
            </tr>
          </TableHeader>
          <TableBody>
            {data.map((order, i) => (
              <TableRow key={i}>
                <TableCell>
                  <div className="flex items-center text-sm">
                    {/* Displaying user.username */}
                    <Avatar
                      className="hidden mr-3 md:block"
                      src={order.user.avatar}
                      alt="User image"
                    />
                    <div>
                      <p className="font-semibold">{order.user.username}</p>
                    </div>
                  </div>
                </TableCell>
                <TableCell>
                  <span className="text-sm">#000{order.id}</span>
                </TableCell>
                <TableCell>
                  <span className="text-sm">$ {order.groupTotalPrice}</span>
                </TableCell>
                <TableCell>
                  <Badge
                    type={
                      order.status === "Un-paid"
                        ? "danger"
                        : order.status === "Paid"
                        ? "success"
                        : order.status === "Completed"
                        ? "warning"
                        : "neutral"
                    }
                  >
                    {order.status}
                  </Badge>
                </TableCell>
                {/* Displaying order type */}
                <TableCell>
                  <span className="text-sm">{order.type}</span>
                </TableCell>
                <TableCell>
                  <span className="text-sm">
                    {new Date(order.date).toLocaleDateString()}
                  </span>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
        <TableFooter>
          <Pagination
            totalResults={totalResults}
            resultsPerPage={resultsPerPage}
            label="Table navigation"
            onChange={onPageChange}
          />
        </TableFooter>
      </TableContainer>
    </div>
  );
};

export default OrdersTable;
